import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'


const Todo = ({todo}) =>{
    return(
        <>
        <li>
            <span>  {todo.data} </span>

           <span> <FontAwesomeIcon icon="fa-sharp fa-solid fa-trash" /> </span>
        </li>
        </>
    )
}

export default Todo ;
